import React,{useState} from 'react';
import './Admin.css';
import {useNavigate} from 'react-router-dom';

function Admin(){

    const navigate = useNavigate();
    const [upperMbti, changeColor] = useState(["E","S","T","J"]);
    const [lowerMbti, changeColor2] = useState(["I","N","F","P"]);
    const [meanMbti] = useState(["energy",'recognition','decision','lifestyle'])

    return (
      <div className="Admin">
        <div className="upperTitle">
          <p>MBTI</p>
          <button onClick={()=>navigate('/')}>
            홈</button>
        </div>

        <div className='addMbti'>
            <p>성향 추가</p>
            <input type='text' placeholder='아래 mbti의 성향을 적어주세요'></input>
        </div>
        <div className="chooseMbti">
          {
            upperMbti.map(function(a,i){
              return(
                <div className='upperMbti'>
                     <button className={meanMbti[i]} 
                     value={a} 
                     onClick={changeColor}>{a}</button>
                </div>
              )
            })
          }
          <div className="meanMbti">
            <p>에너지 방향</p>
            <p>인식 방식</p>
            <p>판단</p>
            <p>생활 양식</p>
          </div>

          {
            lowerMbti.map(function(a,i){
              return(
                <div className='lowerMbti'>
                     <button className={meanMbti[i]} 
                     value={a} 
                     onClick={changeColor2}>{a}</button>
                </div>
              )
            })
          }
           <div className="completeBtn">
                <input type='submit' value={"MBTI 추가"}/>
           </div>
        </div>

        <div className="lowerTitle"></div>

      </div>
    );
}
export default Admin;
